        const lines = csv.trim().split('\n');
        const headers = lines[0].split(',');
        const data = lines.slice(1).map(line => {
            const cols = line.split(',');
            return {
                fecha: cols[1],
                sector: cols[2],
                valor: parseFloat(cols[3])
            };
        });

        const fechas = [...new Set(data.map(d => d.fecha))].sort();
        const sectores = [...new Set(data.map(d => d.sector))];

        const series = sectores.map(sector => ({
            name: sector,
            data: fechas.map(fecha => {
                const found = data.find(d => d.fecha === fecha && d.sector === sector);
                return found ? found.valor : 0;
            }),
            stack: 'sector'
        }));

        Highcharts.chart('container', {
            chart: { type: 'area' },
            title: { text: 'Demanda sectorial de gas natural' },
            legend: {
            align: 'center',
            verticalAlign: 'top',
            layout: 'horizontal'},
            xAxis: {
                categories: fechas,
                title: { text: 'Fecha' },
                tickInterval: Math.ceil(fechas.length / 12),
                labels: { rotation: 45 }
            },
            yAxis: {
                title: {text: 'Demanda de gas natural (MBTU)',
                        style: {fontWeight: 'bold' },
            }},
            tooltip: {
                shared: true,
                valueDecimals: 0
            },
            plotOptions: {
                area: {
                    stacking: 'normal'
                }
            },
            series: series
        });
